import React, { useState } from "react";

function Child(props) {
  //child가 받은 props에는 "김할아가 있겠지"
  return <div>{props.맘미가넘겨준이름}</div>;
}

function Mother(props) {
  //props에 GrandFather에서 받아온 name이 담겨있고, ("김할아") 그걸 또 child에게 넘겨줬음
  return <Child 맘미가넘겨준이름={props.개똥} />;
}

function GrandFather() {
  const [name, setName] = useState("할아버지이름"); // state를 생성
  return <Mother 개똥={name} />;
}

function App() {
  return <GrandFather />;
}

export default App;
